export const optymalizeHtml = (text) => {
  let newText = ``

  let lastChar = ``
  for(const char of text) {
    if((`${lastChar}>`.includes(lastChar) && char === ` `) || char === `\n`) {
      continue
    }

    newText += char
    console.log(newText)
    lastChar = char
  }

  return newText
}
